INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `entitle`, `seo_title`, `excerpt`, `body`, `image`, `slug`, `meta_description`, `meta_keywords`, `status`, `featured`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 1, 3, 'Nuôi heo 4 triệu bán 2 triệu đồng', 'Pig 4 million sold 2 million', 'Nuôi heo 4 triệu bán 2 triệu đồng', 'This is the excerpt for the sample Post', '<p>&nbsp;</p>\r\n<p>This is the body for the sample post, which includes the body.</p>\r\n<h2>We can use all kinds of format!</h2>\r\n<p>And include a bunch of other stuff.</p>', '/storage/posts/7uelXHi85YOfZKsoS6Tq.jpg', 'nuoi-heo-4-trieu-ban-2-trieu-dong', 'Meta Description for sample post', 'keyword1, keyword2, keyword3', 'PUBLISHED', 0, '2017-04-02 14:37:00', '2017-05-04 16:54:59', NULL),
(3, 1, 4, 'Tin tức cuối cùng', 'Latest Post', 'Tin tức cuối cùng', 'This is the excerpt for the latest post', '<p>&nbsp;</p>\r\n<p>This is the body for the latest post</p>', '/storage/posts/9txUSY6wb7LTBSbDPrD9.jpg', 'tin-tuc-cuoi-cung', 'This is the meta description', 'keyword1, keyword2, keyword3', 'PUBLISHED', 0, '2017-04-02 14:37:00', '2017-05-04 16:55:40', NULL),
(4, 1, 1, 'Bài viết hay', 'Yarr Post', 'Bài viết hay', 'Reef sails nipperkin bring a spring upon her cable coffer jury mast spike marooned Pieces of Eight poop deck pillage. Clipper driver coxswain galleon hempen halter come about pressgang gangplank boatswain swing the lead. Nipperkin yard skysail swab lanyard Blimey bilge water ho quarter Buccaneer.', '<p>&nbsp;</p>\r\n<p>Swab deadlights Buccaneer fire ship square-rigged dance the hempen jig weigh anchor cackle fruit grog furl. Crack Jennys tea cup chase guns pressgang hearties spirits hogshead Gold Road six pounders fathom measured fer yer chains. Main sheet provost come about trysail barkadeer crimp scuttle mizzenmast brig plunder.</p>\r\n<p>Mizzen league keelhaul galleon tender cog chase Barbary Coast doubloon crack Jennys tea cup. Blow the man down lugsail fire ship pinnace cackle fruit line warp Admiral of the Black strike colors doubloon. Tackle Jack Ketch come about crimp rum draft scuppers run a shot across the bow haul wind maroon.</p>\r\n<p>Interloper heave down list driver pressgang holystone scuppers tackle scallywag bilged on her anchor. Jack Tar interloper draught grapple mizzenmast hulk knave cable transom hogshead. Gaff pillage to go on account grog aft chase guns piracy yardarm knave clap of thunder.</p>', '/storage/posts/yuk1fBwmKKZdY2qR1ZKM.jpg', 'bai-viet-hay', 'this be a meta descript', 'keyword1, keyword2, keyword3', 'PUBLISHED', 0, '2017-04-02 14:37:00', '2017-05-04 16:55:59', NULL),
(6, 1, 1, 'Vỉa hè trung tâm Sài Gòn bị tái chiếm', 'The sidewalks of Saigon Center were recaptured', NULL, 'Một loạt tuyến đường ở quận 1, TP HCM, bị ôtô và hàng quán chiếm dụng vỉa hè sau khi đoàn liên ngành dừng chấn chỉnh trật tự đô thị, giao các phường tự xử lý.', '<div class="title_news">\r\n<h1>&nbsp;</h1>\r\n</div>\r\n<div class="width_common space_bottom_20">\r\n<div class="block_content_slide_showdetail block_ads_connect">\r\n<div id="article_content">\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_0" class="left" src="http://img.f30.vnecdn.net/2017/05/05/tai-chiem-vua-he-1-ok_680x0.jpg" data-reference-id="24764363" data-component-caption="&lt;p class=" /> Sau một th&aacute;ng đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 dừng chấn chỉnh lấn chiếm vỉa h&egrave; để c&aacute;c phường tự thực hiện, nhiều khu vực xuất hiện t&igrave;nh trạng t&aacute;i lấn chiếm. Trong ảnh, 2 &ocirc;t&ocirc; biển xanh đậu tr&ecirc;n vỉa h&egrave; đối diện số 1 Nam Kỳ Khởi Nghĩa (phường Nguyễn Th&aacute;i B&igrave;nh) trong nhiều giờ." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Sau một th&aacute;ng đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 dừng chấn chỉnh lấn chiếm vỉa h&egrave; để c&aacute;c phường tự thực hiện, nhiều khu vực xuất hiện t&igrave;nh trạng t&aacute;i lấn chiếm. Trong ảnh, 2 &ocirc;t&ocirc; biển xanh đậu tr&ecirc;n vỉa h&egrave; đối diện số 1 Nam Kỳ Khởi Nghĩa (phường Nguyễn Th&aacute;i B&igrave;nh) trong nhiều giờ.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_1" class="left" src="http://img.f29.vnecdn.net/2017/05/04/2-1493915294_680x0.jpg" data-reference-id="24764364" data-component-caption="&lt;p class=" /> Cũng tại phường n&agrave;y, khu vực xung quanh Bảo t&agrave;ng Mỹ Thuật đầy rẫy h&agrave;ng ăn, tiệm đồng hồ, mũ bảo hiểm... thoải m&aacute;i bu&ocirc;n b&aacute;n tr&ecirc;n vỉa h&egrave;." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Cũng tại phường n&agrave;y, khu vực xung quanh Bảo t&agrave;ng Mỹ Thuật đầy rẫy h&agrave;ng ăn, tiệm đồng hồ, mũ bảo hiểm... thoải m&aacute;i bu&ocirc;n b&aacute;n tr&ecirc;n vỉa h&egrave;.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_2" class="left" src="http://img.f31.vnecdn.net/2017/05/04/3-1493915036_680x0.jpg" data-reference-id="24764365" data-component-caption="&lt;p class=" /> Việc bu&ocirc;n b&aacute;n k&eacute;o d&agrave;i ở mặt đường Nguyễn Th&aacute;i B&igrave;nh, Ph&oacute; Đức Ch&iacute;nh nhưng kh&ocirc;ng bị lực lượng chức năng nhắc nhở d&ugrave; chỉ c&aacute;ch UBND phường khoảng 300 m." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Việc bu&ocirc;n b&aacute;n k&eacute;o d&agrave;i ở mặt đường Nguyễn Th&aacute;i B&igrave;nh, Ph&oacute; Đức Ch&iacute;nh nhưng kh&ocirc;ng bị lực lượng chức năng nhắc nhở d&ugrave; chỉ c&aacute;ch UBND phường khoảng 300 m.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_3" class="left" src="http://img.f31.vnecdn.net/2017/05/05/tai-chiem-vua-he-2-ok_680x0.jpg" data-reference-id="24764366" data-component-caption="&lt;p class=" /> T&igrave;nh trạng &ocirc;t&ocirc; đậu tr&ecirc;n vỉa h&egrave; diễn ra ở kh&aacute; nhiều tuyến đường, t&agrave;i xế đ&oacute;ng cửa bỏ đi nơi kh&aacute;c. Trong ảnh l&agrave; chiếc BMW chiếm hết vỉa h&egrave; đường Hồ Hảo Hớn thuộc phường C&ocirc; Giang." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">T&igrave;nh trạng &ocirc;t&ocirc; đậu tr&ecirc;n vỉa h&egrave; diễn ra ở kh&aacute; nhiều tuyến đường, t&agrave;i xế đ&oacute;ng cửa bỏ đi nơi kh&aacute;c. Trong ảnh l&agrave; chiếc BMW chiếm hết vỉa h&egrave; đường Hồ Hảo Hớn thuộc phường C&ocirc; Giang.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_4" class="left" src="http://img.f29.vnecdn.net/2017/05/05/tai-chiem-vua-he-3-ok_680x0.jpg" data-reference-id="24764367" data-component-caption="&lt;p class=" /> Nhiều &ocirc;t&ocirc; d&ugrave;ng "chi&ecirc;u" bật đ&egrave;n nhấp nh&aacute;y, mở cốp sau l&uacute;c đậu tại khu vực cấm dừng, cấm đỗ để đối ph&oacute; lực lượng chức năng c&oacute; thể bất ngờ kiểm tra. Trong ảnh l&agrave; xe biển xanh của tỉnh Ki&ecirc;n Giang đậu hơn 30 ph&uacute;t tr&ecirc;n đường Nguyễn Th&aacute;i B&igrave;nh c&oacute; biển cấm đỗ. T&agrave;i xế kh&ocirc;ng c&oacute; trong xe, kiếng b&ecirc;n h&ocirc;ng cũng được gấp lại." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Nhiều &ocirc;t&ocirc; d&ugrave;ng "chi&ecirc;u" bật đ&egrave;n nhấp nh&aacute;y, mở cốp sau l&uacute;c đậu tại khu vực cấm dừng, cấm đỗ để đối ph&oacute; lực lượng chức năng c&oacute; thể bất ngờ kiểm tra. Trong ảnh l&agrave; xe biển xanh của tỉnh Ki&ecirc;n Giang đậu hơn 30 ph&uacute;t tr&ecirc;n đường Nguyễn Th&aacute;i B&igrave;nh c&oacute; biển cấm đỗ. T&agrave;i xế kh&ocirc;ng c&oacute; trong xe, kiếng b&ecirc;n h&ocirc;ng cũng được gấp lại.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_5" class="left" src="http://img.f31.vnecdn.net/2017/05/04/5-1493915045_680x0.jpg" data-reference-id="24764368" data-component-caption="&lt;p class=" /> T&igrave;nh trạng t&aacute;i chiếm vỉa h&egrave; diễn ra nghi&ecirc;m trọng nhất l&uacute;c S&agrave;i G&ograve;n l&ecirc;n đ&egrave;n. Tại c&aacute;c tuyến đường c&oacute; nhiều qu&aacute;n nhậu, b&agrave;n ghế ngang nhi&ecirc;n được b&agrave;y tr&ecirc;n vỉa h&egrave; để thực kh&aacute;ch ăn uống. Trong ảnh l&agrave; qu&aacute;n nhậu tr&ecirc;n đường Ho&agrave;ng Sa, phường T&acirc;n Định.\r\n<p class="Normal">"Thời gian gần đ&acirc;y lực lượng đ&ocirc; thị cũng bớt kiểm tra. Kh&aacute;ch ưa ngồi ngo&agrave;i h&oacute;ng m&aacute;t, nh&igrave;n ngắm phố phường xe cộ n&ecirc;n ch&uacute;ng t&ocirc;i đ&aacute;nh liều b&agrave;y dưới vỉa h&egrave;", một chủ qu&aacute;n khu n&agrave;y cho biết.</p>\r\n" /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">T&igrave;nh trạng t&aacute;i chiếm vỉa h&egrave; diễn ra nghi&ecirc;m trọng nhất l&uacute;c S&agrave;i G&ograve;n l&ecirc;n đ&egrave;n. Tại c&aacute;c tuyến đường c&oacute; nhiều qu&aacute;n nhậu, b&agrave;n ghế ngang nhi&ecirc;n được b&agrave;y tr&ecirc;n vỉa h&egrave; để thực kh&aacute;ch ăn uống. Trong ảnh l&agrave; qu&aacute;n nhậu tr&ecirc;n đường Ho&agrave;ng Sa, phường T&acirc;n Định.</p>\r\n<p class="Normal">"Thời gian gần đ&acirc;y lực lượng đ&ocirc; thị cũng bớt kiểm tra. Kh&aacute;ch ưa ngồi ngo&agrave;i h&oacute;ng m&aacute;t, nh&igrave;n ngắm phố phường xe cộ n&ecirc;n ch&uacute;ng t&ocirc;i đ&aacute;nh liều b&agrave;y dưới vỉa h&egrave;", một chủ qu&aacute;n khu n&agrave;y cho biết.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_6" class="left" src="http://img.f29.vnecdn.net/2017/05/04/7-1493915049_680x0.jpg" data-reference-id="24764369" data-component-caption="&lt;p class=" /> Xe của thực kh&aacute;ch cũng được c&aacute;c qu&aacute;n dựng chắn hết lối của người đi bộ. "Hơn th&aacute;ng trước, l&uacute;c quận 1 l&agrave;m căng mấy vụ chiếm vỉa h&egrave; họ cũng d&egrave; chừng, &iacute;t b&agrave;y xe. Hiện, mỗi tối đi bộ thể dục ch&uacute;ng t&ocirc;i to&agrave;n phải xuống l&ograve;ng đường v&igrave; xe m&aacute;y chắn hết vỉa h&egrave; rồi. Cố len giữa đống xe th&igrave; nh&acirc;n vi&ecirc;n qu&aacute;n n&eacute;m cho c&aacute;i nh&igrave;n kh&oacute; chịu", &ocirc;ng Phan C&ocirc;ng (63 tuổi) ngụ phường T&acirc;n Định n&oacute;i." /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Xe của thực kh&aacute;ch cũng được c&aacute;c qu&aacute;n dựng chắn hết lối của người đi bộ. "Hơn th&aacute;ng trước, l&uacute;c quận 1 l&agrave;m căng mấy vụ chiếm vỉa h&egrave; họ cũng d&egrave; chừng, &iacute;t b&agrave;y xe. Hiện, mỗi tối đi bộ thể dục ch&uacute;ng t&ocirc;i to&agrave;n phải xuống l&ograve;ng đường v&igrave; xe m&aacute;y chắn hết vỉa h&egrave; rồi. Cố len giữa đống xe th&igrave; nh&acirc;n vi&ecirc;n qu&aacute;n n&eacute;m cho c&aacute;i nh&igrave;n kh&oacute; chịu", &ocirc;ng Phan C&ocirc;ng (63 tuổi) ngụ phường T&acirc;n Định n&oacute;i.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_7" class="left" src="http://img.f30.vnecdn.net/2017/05/05/tai-chiem-vua-he-4-ok_680x0.jpg" data-reference-id="24764370" data-component-caption="&lt;p class=" /> &Ocirc;t&ocirc; n&agrave;y đậu nhiều giờ cạnh qu&aacute;n nhậu tr&ecirc;n đường Trần Cao V&acirc;n, phường Đa Kao.\r\n<p class="Normal">Sau đợt ra qu&acirc;n h&ocirc;m 4/4, đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 tạm dừng xử l&yacute; để c&aacute;c phường tự thực hiện sau chỉ đạo của Th&agrave;nh ủy - giao tr&aacute;ch nhiệm cho người đứng đầu c&aacute;c phường. Đề cập đến việc vỉa h&egrave; bị t&aacute;i chiếm, một số l&atilde;nh đạo phường của quận 1 n&eacute; tr&aacute;nh, số c&ograve;n lại khẳng định tổ c&ocirc;ng t&aacute;c vẫn thường xuy&ecirc;n đi kiểm tra, nhắc nhở nhưng do lực lượng "mỏng" kh&ocirc;ng thể bao qu&aacute;t hết.</p>\r\n" /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">&Ocirc;t&ocirc; n&agrave;y đậu nhiều giờ cạnh qu&aacute;n nhậu tr&ecirc;n đường Trần Cao V&acirc;n, phường Đa Kao.</p>\r\n<p class="Normal">Sau đợt ra qu&acirc;n h&ocirc;m 4/4, đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 tạm dừng xử l&yacute; để c&aacute;c phường tự thực hiện sau chỉ đạo của Th&agrave;nh ủy - giao tr&aacute;ch nhiệm cho người đứng đầu c&aacute;c phường. Đề cập đến việc vỉa h&egrave; bị t&aacute;i chiếm, một số l&atilde;nh đạo phường của quận 1 n&eacute; tr&aacute;nh, số c&ograve;n lại khẳng định tổ c&ocirc;ng t&aacute;c vẫn thường xuy&ecirc;n đi kiểm tra, nhắc nhở nhưng do lực lượng "mỏng" kh&ocirc;ng thể bao qu&aacute;t hết.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_8" class="left" src="http://img.f30.vnecdn.net/2017/05/04/10-1493915055_680x0.jpg" data-reference-id="24764371" data-component-caption="&lt;p class=" /> Lấy tư c&aacute;ch l&agrave; người d&acirc;n TP HCM, &ocirc;ng Đo&agrave;n Ngọc Hải cho biết t&igrave;nh trạng t&aacute;i chiếm đang diễn ra ở một số nơi, nhất l&agrave; c&aacute;c qu&aacute;n nhậu về đ&ecirc;m. Một số nh&agrave; h&agrave;ng từng bị &ocirc;ng xử phạt v&igrave; chiếm vỉa h&egrave; nay lại t&aacute;i diễn.\r\n<p class="Normal">"C&aacute;n bộ quận 1 thấy tội phạm m&agrave; sợ h&atilde;i, thấy vỉa h&egrave; bầy hầy, nhếch nh&aacute;c m&agrave; kh&ocirc;ng l&agrave;m th&igrave; kh&ocirc;ng xứng đ&aacute;ng nhận lương h&agrave;ng th&aacute;ng của người d&acirc;n đ&oacute;ng thuế. Đối với việc chấn chỉnh vỉa h&egrave;, nếu kh&ocirc;ng quyết liệt th&igrave; đừng mong c&oacute; một đ&ocirc; thị đẹp", &ocirc;ng Hải n&oacute;i.</p>\r\n<p class="Normal">Về việc đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 dừng ra qu&acirc;n hơn một th&aacute;ng nay, &ocirc;ng Hải cho biết đ&oacute; l&agrave; chỉ đạo của l&atilde;nh đạo quận. Tuy nhi&ecirc;n, Ph&oacute; chủ tịch phụ tr&aacute;ch đ&ocirc; thị vẫn theo d&otilde;i t&igrave;nh h&igrave;nh.</p>\r\n" /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Lấy tư c&aacute;ch l&agrave; người d&acirc;n TP HCM, &ocirc;ng Đo&agrave;n Ngọc Hải cho biết t&igrave;nh trạng t&aacute;i chiếm đang diễn ra ở một số nơi, nhất l&agrave; c&aacute;c qu&aacute;n nhậu về đ&ecirc;m. Một số nh&agrave; h&agrave;ng từng bị &ocirc;ng xử phạt v&igrave; chiếm vỉa h&egrave; nay lại t&aacute;i diễn.</p>\r\n<p class="Normal">"C&aacute;n bộ quận 1 thấy tội phạm m&agrave; sợ h&atilde;i, thấy vỉa h&egrave; bầy hầy, nhếch nh&aacute;c m&agrave; kh&ocirc;ng l&agrave;m th&igrave; kh&ocirc;ng xứng đ&aacute;ng nhận lương h&agrave;ng th&aacute;ng của người d&acirc;n đ&oacute;ng thuế. Đối với việc chấn chỉnh vỉa h&egrave;, nếu kh&ocirc;ng quyết liệt th&igrave; đừng mong c&oacute; một đ&ocirc; thị đẹp", &ocirc;ng Hải n&oacute;i.</p>\r\n<p class="Normal">Về việc đo&agrave;n li&ecirc;n ng&agrave;nh quận 1 dừng ra qu&acirc;n hơn một th&aacute;ng nay, &ocirc;ng Hải cho biết đ&oacute; l&agrave; chỉ đạo của l&atilde;nh đạo quận. Tuy nhi&ecirc;n, Ph&oacute; chủ tịch phụ tr&aacute;ch đ&ocirc; thị vẫn theo d&otilde;i t&igrave;nh h&igrave;nh.</p>\r\n</div>\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n<div class="item_slide_show">\r\n<div class="block_thumb_slide_show"><img id="vne_slide_image_9" class="left" src="http://img.f29.vnecdn.net/2017/05/04/11-1493915057_680x0.jpg" data-reference-id="24764372" data-component-caption="&lt;p class=" /> Chiến dịch chấn chỉnh trật tự đ&ocirc; thị, đảm bảo mỹ quan trung t&acirc;m th&agrave;nh phố được quận 1 khởi xướng từ đầu năm. Đo&agrave;n li&ecirc;n ng&agrave;nh quận đ&atilde; xử l&yacute; h&agrave;ng ngh&igrave;n vi phạm, cho đập nhiều hạng mục của cơ quan Nh&agrave; nước, kh&aacute;ch sạn 5 sao... lấn vỉa h&egrave;; cẩu h&agrave;ng chục xe biển xanh vi phạm.\r\n<p class="Normal">Phong tr&agrave;o dọn dẹp vỉa h&egrave; sau đ&oacute; lan tỏa khắp 24 quận huyện TP HCM v&agrave; nhiều tỉnh th&agrave;nh của cả nước. Trước những phản ứng tr&aacute;i chiều của người d&acirc;n, l&atilde;nh đạo th&agrave;nh phố nhắc nhở &ocirc;ng Hải l&agrave;m nghi&ecirc;m nhưng phải đ&uacute;ng luật.</p>\r\n" /&gt;<a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n<div class="desc_cation">\r\n<p class="Normal">Chiến dịch chấn chỉnh trật tự đ&ocirc; thị, đảm bảo mỹ quan trung t&acirc;m th&agrave;nh phố được quận 1 khởi xướng từ đầu năm. Đo&agrave;n li&ecirc;n ng&agrave;nh quận đ&atilde; xử l&yacute; h&agrave;ng ngh&igrave;n vi phạm, cho đập nhiều hạng mục của cơ quan Nh&agrave; nước, kh&aacute;ch sạn 5 sao... lấn vỉa h&egrave;; cẩu h&agrave;ng chục xe biển xanh vi phạm.</p>\r\n<p class="Normal">Phong tr&agrave;o dọn dẹp vỉa h&egrave; sau đ&oacute; lan tỏa khắp 24 quận huyện TP HCM v&agrave; nhiều tỉnh th&agrave;nh của cả nước. Trước những phản ứng tr&aacute;i chiều của người d&acirc;n, l&atilde;nh đạo th&agrave;nh phố nhắc nhở &ocirc;ng Hải l&agrave;m nghi&ecirc;m nhưng phải đ&uacute;ng luật.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '/storage/posts/yuk1fBwmKKZdY2qR1ZKM.jpg', 'via-he-trung-tam-sai-gon-bi-tai-chiem', NULL, NULL, 'PUBLISHED', 0, '2017-05-04 16:17:50', '2017-06-20 08:47:39', NULL),
(9, 3, 1, 'Chủ tịch TP Đà Nẵng đi chợ để nghe ý kiến tiểu thương', 'Chairman of the Danang city market to hear comments micro', 'Chủ tịch TP Đà Nẵng đi chợ để nghe ý kiến tiểu thương', 'Chủ tịch UBND TP Đà Nẵng đã xuống chợ, đến từng ki-ốt kiểm tra và lắng nghe ý kiến của tiểu thương, nông dân về việc xây dựng 2 chợ mới ở quận Sơn Trà.', '<p>S&aacute;ng 5/5, &ocirc;ng Huỳnh Đức Thơ, Chủ tịch UBND TP Đ&agrave; Nẵng đến kiểm tra c&ocirc;ng t&aacute;c giải ph&oacute;ng mặt bằng v&agrave; đầu tư x&acirc;y dựng tại chợ Mai v&agrave; chợ An Hải Bắc (quận Sơn Tr&agrave;, TP Đ&agrave; Nẵng).</p>\r\n<p>Khi &ocirc;ng Thơ kiểm tra tiến độ x&acirc;y dựng tại chợ Mai (phường Thọ Quang, quận Sơn Tr&agrave;), đại diện chủ đầu tư cho biết hiện nay việc giải ph&oacute;ng mặt bằng đang gặp kh&oacute; khăn, v&igrave; một số hộ d&acirc;n bị thu đất n&ocirc;ng nhiệp chưa đồng &yacute; giao đất. Những hộ d&acirc;n n&agrave;y y&ecirc;u cầu bố tr&iacute; ki-ốt để họ bu&ocirc;n b&aacute;n v&agrave; c&oacute; ch&iacute;nh s&aacute;ch hỗ trợ th&ecirc;m để b&agrave; con c&oacute; thể thu&ecirc; đất trồng rau.</p>', '/storage/posts/nlje9NZQ7bTMYOUG4lF1.jpg', 'chu-tich-tp-da-nang-di-cho-de-nghe-y-kien-tieu-thuong', NULL, NULL, 'PENDING', 0, '2017-05-04 19:18:38', '2017-06-20 08:50:32', NULL),
(10, 1, 1, 'Chủ tịch TP Đà Nẵng đi chợ để nghe ý kiến tiểu thương 1', 'Chairman of the Danang city market to hear comments micro 1', 'Chủ tịch TP Đà Nẵng đi chợ để nghe ý kiến tiểu thương 1', 'Chủ tịch UBND TP Đà Nẵng đã xuống chợ, đến từng ki-ốt kiểm tra và lắng nghe ý kiến của tiểu thương, nông dân về việc xây dựng 2 chợ mới ở quận Sơn Trà.', '<p>S&aacute;ng 5/5, &ocirc;ng Huỳnh Đức Thơ, Chủ tịch UBND TP Đ&agrave; Nẵng đến kiểm tra c&ocirc;ng t&aacute;c giải ph&oacute;ng mặt bằng v&agrave; đầu tư x&acirc;y dựng tại chợ Mai v&agrave; chợ An Hải Bắc (quận Sơn Tr&agrave;, TP Đ&agrave; Nẵng).</p>\r\n<p>Khi &ocirc;ng Thơ kiểm tra tiến độ x&acirc;y dựng tại chợ Mai (phường Thọ Quang, quận Sơn Tr&agrave;), đại diện chủ đầu tư cho biết hiện nay việc giải ph&oacute;ng mặt bằng đang gặp kh&oacute; khăn, v&igrave; một số hộ d&acirc;n bị thu đất n&ocirc;ng nhiệp chưa đồng &yacute; giao đất. Những hộ d&acirc;n n&agrave;y y&ecirc;u cầu bố tr&iacute; ki-ốt để họ bu&ocirc;n b&aacute;n v&agrave; c&oacute; ch&iacute;nh s&aacute;ch hỗ trợ th&ecirc;m để b&agrave; con c&oacute; thể thu&ecirc; đất trồng rau.</p>', '/storage/posts/Republic-Of-Gamers-by-Syrth-Creations.png', 'chu-tich-tp-da-nang-di-cho-de-nghe-y-kien-tieu-thuong-1', NULL, NULL, 'PENDING', 0, '2017-05-13 07:59:10', '2017-07-24 11:04:02', NULL);
